(self.webpackChunkbugu=self.webpackChunkbugu||[]).push([[634],{9089:(e,i,a)=>{"use strict";a.r(i),a.d(i,{data:()=>t});const t={key:"v-4e089454",path:"/iOS/%E6%8E%92%E6%9F%A5%E9%A1%B9%E7%9B%AE%E5%8C%85%E5%90%ABUIWebView%E7%9A%84%E6%96%87%E4%BB%B6%E4%B8%8E%E9%9D%99%E6%80%81%E5%BA%93%E6%96%B9%E6%B3%95.html",title:"排查项目包含UIWebView的文件与静态库方法",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"Problem",slug:"problem",children:[]},{level:2,title:"Analysis",slug:"analysis",children:[]},{level:2,title:"Solution",slug:"solution",children:[]}],filePathRelative:"iOS/排查项目包含UIWebView的文件与静态库方法.md",git:{updatedTime:1598927806e3}}},5498:(e,i,a)=>{"use strict";a.r(i),a.d(i,{default:()=>l});const t=(0,a(6252).uE)('<h1 id="排查项目包含uiwebview的文件与静态库方法"><a class="header-anchor" href="#排查项目包含uiwebview的文件与静态库方法">#</a> 排查项目包含UIWebView的文件与静态库方法</h1><h2 id="problem"><a class="header-anchor" href="#problem">#</a> Problem</h2><p>发布App Store不成功，查看不到构建版本，收到官方拒绝邮件。 信息如下：</p><blockquote><p>ITMS-90809: Deprecated API Usage - Apple will stop accepting submissions of apps that use UIWebView APIs . See https://developer.apple.com/documentation/uikit/uiwebview for more information.</p></blockquote><blockquote><p>New apps that use UIWebView are no longer accepted. Instead, use WKWebView for improved security and reliability. Learn more(https://developer.apple.com/documentation/uikit/uiwebview).</p></blockquote><h2 id="analysis"><a class="header-anchor" href="#analysis">#</a> Analysis</h2><p><code>UIWebView</code>苹果官方已经弃用，新上架的应用中检测到<code>UIWebView</code>会被拒绝。由新的组件<code>WKWebView</code>代替。一些第三方的构架里面没有删除的，需要注意。</p><h2 id="solution"><a class="header-anchor" href="#solution">#</a> Solution</h2><p>排查项目包含UIWebView的文件与静态库。</p><p>打开终端控制台，<code>cd 到项目目录</code>，使用脚本排查 <code>grep -r UIWebView . </code>（脚本包含最后一个标点符号）</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>grep -r UIWebView .\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>执行以上代码，会得到项目中具体包含UIWebView 静态库或者文件的名称及相关代码。</p>',12),l={render:function(e,i){return t}}}}]);